import React, { useEffect, useState } from "react";
import { vendiaClient } from "./vendiaClient";

const {client} = vendiaClient();

export const Demo = () => {

    const [device, setDevice] = useState();
    const [testName, setTestName] = useState();
    const [deviceList, setDeviceList] = useState();

    useEffect(() => {
        const listDevices = async () => {
            const listDevicesResponse = await client.entities.test.list();
            console.log(listDevicesResponse);
        }
    listDevices();
    }, [])

    const addDevice = async () => {
        const addDeviceResponse = await client.entities.test.add({
            Device: "Testing Programatically",
            TestID: 345
        })
        console.log(addDeviceResponse)
    }


    return (
        <div>
            CSUS Fall 2023
            <div>
                <form>
                    <div>
                        <input 
                        type="text" 
                        name ="Device"
                        value={device}
                        />
                    </div>

                    <div>
                        <input type="text" />
                    </div>
                </form>
            </div>
        </div>
    )
}
